import React, { useState } from 'react';
import * as s from './splitStyle';

const split = () => (
  <div style={{ padding: '50px' }}>
    <s.FilterTimeSlide>
      <s.FilterTimeSlideInner
        rangeMinPercent={rangeMinPercent}
        rangeMaxPercent={rangeMaxPercent}
      />
    </s.FilterTimeSlide>
    <s.FilterTimeRangeWrap>
      <s.FilterTimeRangeMin
        type="range"
        min={fixedMinPrice}
        max={fixedMaxPrice - priceGap}
        step="1000"
        value={rangeMinValue}
        onChange={(e) => {
          prcieRangeMinValueHandler(e);
          twoRangeHandler();
        }}
      />
      <s.FilterTimeRangeMax
        type="range"
        min={fixedMinPrice + priceGap}
        max={fixedMaxPrice}
        step="1000"
        value={rangeMaxValue}
        onChange={(e) => {
          prcieRangeMaxValueHandler(e);
          twoRangeHandler();
        }}
      />
    </s.FilterTimeRangeWrap>
  </div>
);

export default split;
